import React, { useState } from "react";
import useSignUpForm from '../components/CustomHooks';
const {inputs, handleInputChange, handleSubmit} = useSignUpForm();



function Add() {

    const [state, setState] = useState([{
        id: 1,
        name: "Lawrence",
        powerlevel: 9000,
        age: 24
      },
    {
        id: 2,
        name: "Pam",
        powerlevel: 9000,
        age: 24
      }]); 

return(
  <form onSubmit={handleSubmit}>
  <label>Name</label>
  <input  name="firstName" type="text" onChange={handleInputChange} value={inputs.firstName} required/>
  <label> Power Level</label>
  <input  name="powerLevel" type="text" onChange={handleInputChange} value={inputs.firstName} required />
  <label> Age</label>
  <input  name="age" type="text" onChange={handleInputChange} value={inputs.firstName} required />
  <button type="text">Add</button>
</form>
  );
}
 
export default Add;
